import React from "react"
import  "./interaction.css"
import InteractionCard from "./interactionCard"


class Interaction extends React.Component {
    constructor(props) {
        super(props)
        this.state = {
            questions: [
                {
                    type:"单选题",
                    description:"这是一个单选题的示例。",
                    status:"answered",
                    id:"1"
                },
                {
                    type:"多选题",
                    description:"这是一个多选题的示例。",
                    status:"answered",
                    id:"2"
                },
                {
                    type:"单选题",
                    description:"这是一个单选题的示例。",
                    status:"answered",
                    id:"3"
                }
            ]
        }
    }

    render() {

        const {  questions } = this.state;

        return(
            <div>
                {questions.slice(0, questions.length).map((question, index) => (
                <InteractionCard
                    key={index}
                    type={question.type}
                    description={question.description}
                    status={question.status}
                    index={question.id}
                />
                ))}
            </div>
        )
    }
}

export default Interaction
